async function importar() {
  for (const p of productos) {
    try {
      await pool.query(
        'INSERT INTO productos (nombre, precio, stock, imagen) VALUES ($1, $2, $3, $4)',
        [p.name, p.price, p.stock, p.image]
      );
      console.log(`✅ Insertado: ${p.name}`);
    } catch (err) {
      console.error(`❌ Error con ${p.name}:`, err.message);
    }
  }
  console.log('--- FINALIZADO ---');
  process.exit();
}

